import { FarmConfig } from './types'

const farms: FarmConfig[] = [
  /**
   * These 3 farms (PID 0, 251, 252) should always be at the top of the file.
   */
  {
    pid: 0,
    lpSymbol: 'CAKE',
    lpAddresses: {
      81457: '',
      97: '',
      56: '0xD0Dc1Af4f93916D662fdbCfaf5b5e2904F7d5514',  // gmt eth BLAST
    },
    token: tokens.cake,
    quoteToken: tokens.wbnb,
  },
  {
    pid: 251,
    lpSymbol: 'CAKE-BNB LP',
    lpAddresses: {
      81457: '',
      97: '',
      56: '0xD0Dc1Af4f93916D662fdbCfaf5b5e2904F7d5514', // gmt - eth LP  BLAST
    },
    token: tokens.cake,
    quoteToken: tokens.wbnb,
  },
  {
    pid: 252,
    lpSymbol: 'BUSD-BNB LP',
    lpAddresses: {
      81457: ' 0xc715cB6E8A172473d56221218586cCea6b33428a',
      97: '',      
      56: '0x58F876857a02D6762E0101bb5C46A8c1ED44Dc16', //  USDB - ETH LP
    },
    token: tokens.busd,
    quoteToken: tokens.wbnb,
  },

]

export default farms
